window.bookSummaryJSON = "<p>Sacrifice your soul mate or watch the world burn?</p> <p>Nord and Lina have walked through seemingly insurmountable trials to be together. With a love that couldn’t be stopped, not even by death, they’ve come out the other side stronger than before. But their fight isn’t over, not by a long shot. One final enemy remains, and this time, victory has never been less certain.</p> <p>Ending this war will take more than they’re willing to give. But there’s no turning back now. Lines have been drawn, shots fired, with devastating consequences. All they can do is fight like forever is on the line, because it is.</p> <p><i>Call of Danger</i> is the pulse-pounding, heart-wrenching, won’t-let-you-go-til-the-very-last-moment, final installment in Nord and Lina’s epic love story. Buckle up. The road to this happily ever after is far from easy.</p>"; 
